import{_ as t,c as a,o as s,ae as o}from"./chunks/framework.DRno8Cka.js";const l="/RBQ/assets/leg_1.DKO2uQ7N.png",r="/RBQ/assets/leg_2.CzzOSRv7.png",n="/RBQ/assets/leg_3.DVqd9flL.png",h="/RBQ/assets/leg_4.Cq0GZik2.png",i="/RBQ/assets/leg_5.Ajf9WV9T.png",m="/RBQ/assets/leg_6.DELQCNnU.png",c="/RBQ/assets/leg_7.BMfu3XLX.png",u="/RBQ/assets/leg_8.Df9hqWrr.png",q=JSON.parse('{"title":"Leg module Attachment/Detachment","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"manual/Maintenance/leg-module.md","filePath":"manual/Maintenance/leg-module.md","lastUpdated":1750224677000}'),d={name:"manual/Maintenance/leg-module.md"};function g(p,e,f,b,w,_){return s(),a("div",null,e[0]||(e[0]=[o('<h1 id="leg-module-attachment-detachment" tabindex="-1">Leg module Attachment/Detachment <a class="header-anchor" href="#leg-module-attachment-detachment" aria-label="Permalink to &quot;Leg module Attachment/Detachment&quot;">​</a></h1><p>This manual explains the disassembly and assembly sequence of the RBQ10 leg module. The instructions are based on the front left leg, and since the other legs have a symmetrical structure, the same method should be used for the disassembly and assembly process. Please note that the spring washer for the bolts securing the leg is crucial for proper fastening, so be careful not to forget it during assembly.</p><h2 id="leg-module-disassembly" tabindex="-1">Leg module disassembly <a class="header-anchor" href="#leg-module-disassembly" aria-label="Permalink to &quot;Leg module disassembly&quot;">​</a></h2><p>The bolts fastening the leg module are placed as shown below.</p><figure><img src="'+l+'" alt="missing"></figure><h3 id="step-1-unscrew-the-bolts-fastening-the-leg-module-there-are-6-bolts-in-total-use-a-4mm-hex-wrench-dispose-of-the-used-m5-spring-washers" tabindex="-1">Step 1. Unscrew the bolts fastening the leg module. There are 6 bolts in total, use a 4mm hex wrench. Dispose of the used M5 spring washers. <a class="header-anchor" href="#step-1-unscrew-the-bolts-fastening-the-leg-module-there-are-6-bolts-in-total-use-a-4mm-hex-wrench-dispose-of-the-used-m5-spring-washers" aria-label="Permalink to &quot;Step 1. Unscrew the bolts fastening the leg module. There are 6 bolts in total, use a 4mm hex wrench. Dispose of the used M5 spring washers.&quot;">​</a></h3><h3 id="step-2-pull-the-leg-module-outward-after-the-bolts-are-unscrewed-be-careful-not-to-damage-the-com-wire-by-pulling-it-too-far" tabindex="-1">Step 2. Pull the leg module outward after the bolts are unscrewed. Be careful not to damage the com-wire by pulling it too far. <a class="header-anchor" href="#step-2-pull-the-leg-module-outward-after-the-bolts-are-unscrewed-be-careful-not-to-damage-the-com-wire-by-pulling-it-too-far" aria-label="Permalink to &quot;Step 2. Pull the leg module outward after the bolts are unscrewed. Be careful not to damage the com-wire by pulling it too far.&quot;">​</a></h3><figure><img src="'+r+'" alt="missing"></figure><h3 id="step-3-after-removing-the-leg-module-pull-the-connector-handle-to-release-the-com-wire" tabindex="-1">Step 3. After removing the leg module, pull the connector handle to release the com-wire. <a class="header-anchor" href="#step-3-after-removing-the-leg-module-pull-the-connector-handle-to-release-the-com-wire" aria-label="Permalink to &quot;Step 3. After removing the leg module, pull the connector handle to release the com-wire.&quot;">​</a></h3><blockquote><p>⚠️ Pulling the wire may cause disconnection. Make sure to pull the handle.</p></blockquote><figure><img src="'+n+'" alt="missing"></figure><figure><img src="'+h+'" alt="missing"></figure><h2 id="leg-module-assembly" tabindex="-1">Leg module assembly <a class="header-anchor" href="#leg-module-assembly" aria-label="Permalink to &quot;Leg module assembly&quot;">​</a></h2><p>The leg com-cable must be rolled once before assembly. If it is assembled without rotation, the com-cable may get pinched and damaged between the leg and the upper and lower plates.</p><h3 id="step-1-roll-the-com-cables-as-shown-in-the-picture-below" tabindex="-1">Step 1. Roll the com-cables as shown in the picture below. <a class="header-anchor" href="#step-1-roll-the-com-cables-as-shown-in-the-picture-below" aria-label="Permalink to &quot;Step 1. Roll the com-cables as shown in the picture below.&quot;">​</a></h3><figure><img src="'+i+'" alt="missing"></figure><h3 id="step-2-align-the-red-dots-of-the-connector-and-press-firmly-to-connect-the-cable" tabindex="-1">Step 2. Align the red dots of the connector and press firmly to connect the cable. <a class="header-anchor" href="#step-2-align-the-red-dots-of-the-connector-and-press-firmly-to-connect-the-cable" aria-label="Permalink to &quot;Step 2. Align the red dots of the connector and press firmly to connect the cable.&quot;">​</a></h3><blockquote><p>⚠️ Pushing the cable may cause disconnection! Make sure to press the handle.</p></blockquote><figure><img src="'+m+'" alt="missing"></figure><h3 id="step-3-insert-the-outer-roll-frame-and-the-roll-reducer-slot-into-the-body-frame" tabindex="-1">Step 3. Insert the outer roll frame and the roll reducer slot into the body frame. <a class="header-anchor" href="#step-3-insert-the-outer-roll-frame-and-the-roll-reducer-slot-into-the-body-frame" aria-label="Permalink to &quot;Step 3. Insert the outer roll frame and the roll reducer slot into the body frame.&quot;">​</a></h3><figure><img src="'+c+'" alt="missing"></figure><h3 id="step-4-screw-the-bolts-fixing-the-leg-module-there-are-6-bolts-in-total-use-a-4mm-hex-wrench-make-sure-to-insert-the-m5-spring-washers" tabindex="-1">Step 4. Screw the bolts fixing the leg module. There are 6 bolts in total, use a 4mm hex wrench. Make sure to insert the M5 spring washers. <a class="header-anchor" href="#step-4-screw-the-bolts-fixing-the-leg-module-there-are-6-bolts-in-total-use-a-4mm-hex-wrench-make-sure-to-insert-the-m5-spring-washers" aria-label="Permalink to &quot;Step 4. Screw the bolts fixing the leg module. There are 6 bolts in total, use a 4mm hex wrench. Make sure to insert the M5 spring washers.&quot;">​</a></h3><figure><img src="'+u+'" alt="missing"></figure>',23)]))}const x=t(d,[["render",g]]);export{q as __pageData,x as default};
